import React from 'react';
import '../stylesheets/home.css';


const Tasks = (store) => store.map(i =>
    <li>{i}</li>
)

function Home() {
    return (
        <div className="home">
            <ol>
                {Tasks(props.getState.todos)}
            </ol>
        </div>
    );
}

export default Home;
